import { useState } from "react";

function App() {
  const [loading, setLoading] = useState(true);
  const [rockets, setRocket] = useState([]);

  const getMovies = async () => {
    const json = await (
      await fetch("https://api.spacexdata.com/v3/rockets")
    ).json();
    setRocket(json.data.rockets);
    setLoading(false);
  }
  return (
    <div>
      {loading ? "loading" : <div>
    {rockets.map((rocket) => (
      <div key={rocket.id}>
        <h2> {rocket.contry} </h2>
      </div>
    ))}
  </div>}
